import React from "react";

import {
  Button,
  Dialog,
  DialogTitle,
  Grid,
  TextField,
} from "@material-ui/core";
import styled from "styled-components";

const GridContainerStyled = styled(Grid)`
  padding: 10px;
`

const GridItemStyled = styled(Grid)`
  margin-bottom: 10px;
`

export interface CreateTechnologyProps {
  handleClose: () => void;
  open: boolean;
}

const CreateTechnology: React.FC<CreateTechnologyProps> = ({
  handleClose,
  open,
}) => {
  return (
    <Dialog
      onClose={handleClose}
      aria-labelledby="simple-dialog-title"
      open={open}
    >
      <DialogTitle>Add Technology</DialogTitle>
      <GridContainerStyled container direction="column" alignItems="center" justify="space-evenly">
        <GridItemStyled item>
          <TextField />
        </GridItemStyled>
        <GridItemStyled item>
          <Button variant="contained" color="primary">
            ADD
          </Button>
        </GridItemStyled>
      </GridContainerStyled>
    </Dialog>
  );
};

export default CreateTechnology;
